import './homepage.css';
import logo from '../logo.png';

const Homepage = () =>{
    return (
        <>
        <img src={logo} alt="logo"  />
        <div className="login">
        <h1> Home Page</h1>

        <div><button href="/">Log Out</button></div>
        <a href="/">Change Password</a>
        </div>
        </>
    );
}
export default Homepage;
